import logo from "./logo.svg";
import "./App.css";

function App() {
  const name = "Alpha";

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>Hello World!</p>

        <p>{"Alpha"}</p>
        <p>{[1, 2, 3]}</p>
        <p>{name}</p>
      </header>
    </div>
  );
}

export default App;
